import React from 'react';
import {Link} from "react-router-dom";
import styles from './Header.Module.css';



const Header = () => {
  return (
    <header className={styles.header}>
      <div className={styles.contents}>

      <Link to="/">리뷰터리</Link>

      <hr/>
      </div>
    </header>
  );
};

export default Header;
